def histogram(test):
    """Given a string representing a space separated lowercase letters, return a dictionary
    of the letter with the most repetition and containing the corresponding count.
    If several letters have the same occurrence, return all of them.

    Example:
    histogram('a b c') == {'a': 1, 'b': 1, 'c': 1}
    histogram('a b b a') == {'a': 2, 'b': 2}
    histogram('a b c a b') == {'a': 2, 'b': 2}
    histogram('b b b b a') == {'b': 4}
    histogram('') == {}

    """

    # Create an empty dictionary to store the histogram
    hist = {}

    # Split the input string into a list of words
    words = test.split()

    # Iterate through the list of words
    for word in words:
        # If the word is not already in the histogram, add it with count 1
        if word not in hist:
            hist[word] = 1
        # If the word is already in the histogram, increment its count
        else:
            hist[word] += 1

    # Find the maximum count in the histogram
    max_count = max(hist.values())

    # Create an empty dictionary to store the result
    result = {}

    # Iterate through the keys in the histogram
    for key in hist:
        # If the count for the key is equal to the maximum count, add it to the result
        if hist[key] == max_count:
            result[key] = max_count

    # Return the result
    return result

