def do_algebra(operator, operand):
    # Initialize the result with the first operand
    result = operand[0]
    # Loop over the rest of the operands and operators
    for i in range(1, len(operand)):
        if operator[i-1] == '+':
            result += operand[i]
        elif operator[i-1] == '-':
            result -= operand[i]
        elif operator[i-1] == '*':
            result *= operand[i]
        elif operator[i-1] == '//':
            result //= operand[i]
        elif operator[i-1] == '**':
            result **= operand[i]
        else:
            raise ValueError("Invalid operator")
    return result
